import './home.css';
import {useState, useEffect } from 'react';
const Home = () => {
    const [cata, setCata] = useState()

    useEffect(() => {
        fetch('https://www.themealdb.com/api/json/v1/1/categories.php/categories')
            .then(response => response.json())
            .then(json => setCata(json));
    }, []);
    return (
        <div>
            {cata.map(catagory => (
                <h1 key={catagory.idCategory}>{catagory.strCatagory}</h1>
            ))}
        </div>
    );
}

export default Home;
